 import React from "react";
 import { useLocation , Link } from "react-router-dom";

 const Gamepage = () => {
    const location = useLocation();
    return (
        <div>
            <h2>{location.state.username}</h2>
            <h2>{location.state.score}</h2>
            <Link to="/Game">
                <button>Play Again</button>
            </Link>
        </div>
    )
 }

 export default Gamepage;
